import React from 'react';
import './ProjectCard.css';
import '../App.css';

function ProjectCard() {
  return (
    <div className="card-grid light-bkgd dark-blue flex-center-h">
      <div className="card">
        <img
          src={`https://source.unsplash.com/random/?sig=${
            new Date().getTime().toString() + Math.random()
          }`}
        />
      </div>
      <div className="card">
        <img src={`https://source.unsplash.com/random/?sig=${Math.random()}`} />
      </div>
      <div className="card">
        <img src={`https://source.unsplash.com/random/?sig=${Math.random()}`} />
      </div>
      <div className="card">
        <img src={`https://source.unsplash.com/random/?sig=${Math.random()}`} />
      </div>
    </div>
  );
}

export default ProjectCard;
